const article__title=$(".article__title"),resizeArticle=()=>{if($(window).width()<1440&&$(window).width()>769)for(let e=0;e<article__title.length;e++)article__title.eq(e).prependTo($(".containerTitleJS").eq(e));else if($(window).width()<769)for(let e=0;e<article__title.length;e++)article__title.eq(e).prependTo($(".columnTitleJS").eq(e))};resizeArticle();